import React,{ useState } from "react";

import { backend_url } from "../../../Components/configurations";

const History = () => {
    const [allRows, setAllRows] = useState({})
    const [count,setCount] = useState(0)

    const handleFetch = async () => {
        try{
            const accessToken = localStorage.getItem('access_token')
            const user = localStorage.getItem('user')

            const response = await fetch(`${backend_url}user/account_status/?user=${user}`, {
                method: 'GET',
                headers:{
                  'Authorization': `Bearer ${accessToken}`,
                }
              }).then(response => response.json())
              .then(data => {
                setAllRows(data.all_rows);
                setCount(data.count);
                console.log(count)
            })
        } catch (error){
            console.log('error occured',error)
        }
    }

    return(
        <div>
            <button className="btn btn-primary mt-5" onClick={handleFetch}>GET DATA</button>
        </div>
    )
}

export default History;
